import React, {useState} from 'react';
import logo from './logo.svg';
import './App.css';
import LayOut from './Components/LayOut';
import {
  Routes,
  Route,
} from "react-router-dom";
import LandingPage from './Pages/LandingPage';
import Register from './Pages/Register';
import Products from './Pages/Products';
import ViewProduct from './Pages/ViewProduct';
import Cart from './Pages/Cart'
import SignUp from './Pages/SignUp';
import SignIn from './Pages/SignIn';
import {useReducer, createContext} from 'react'




type InitialStateType = {
  cartCount : number
}

const initialState = {
 cartCount: 0
}
type Actions = "setCart"

function reducer(state, action: { [key: string]: string|number }) { // error Parameter 'action' implicitly has an 'any' type.
  return { count: state.count + 1 }
}

export const CountContext = createContext<{
  state: InitialStateType;
  dispatch: React.Dispatch<any>;
}>({
  state: initialState,
  dispatch: () => null
});


function App() {
  const [cartCount, dispatch] = useReducer(reducer, initialState)
  return (  
      <CountContext.Provider value={{ cartCount, dispatch}}>
        <LayOut>
        <Routes>
            <Route path='/' element={<LandingPage />}/>
            <Route path='/allProducts' element={<Products category={'men'} />}/>
            <Route path='/register' element={<Register />}/>
            <Route path='/viewproduct' element={<ViewProduct />}/>
            <Route path='/cart' element={<Cart />}/>
            <Route path='/signup' element={<SignUp />}/>
            <Route path='/signin' element={<SignIn />}/>
        </Routes> 
        </LayOut>
    </CountContext.Provider>
  );
}

export default App;
